'use strict';

const defaultImage = 'data:image/jpeg;base64,';
const createBTN = document.querySelector('.create-btn');
const result = document.querySelector('.result');
const dataCard = {
  'palette': 1,
  'name': 'Carlos Mananas',
  'job': 'Tuerto',
  'phone': '+34 555435345',
  'email': 'carlos@adalab.es',
  'linkedin': 'oneeyedman',
  'github': 'oneeyedman',
  'photo': defaultImage
};

const createCard = () => {
  fetch('https://us-central1-awesome-cards-cf6f0.cloudfunctions.net/card/', {
    method: 'POST',
    body: JSON.stringify(dataCard),
    headers: {
      'content-type': 'application/json'
    },
  })
    .then(response => response.json())
    .then(data => {
      console.log(data);
      result.innerHTML = `<a href="${data.cardURL}">${data.cardURL}</a>`;
    });

};

createBTN.addEventListener('click', createCard);
